javascript/callback.html.body:
Callback
Issue
jQueryUI - Dialog - Modal form 구현 부분
buttons: [
            {
                text: "Confirm",
                click: confirmAction(); // click 할 때가 아니라 loading시에 바로 실행 됨.
            },

Resolve
buttons: [
            {
                text: "Confirm",
                click: function() {
                    confirmAction(); // click 할 때 실행 됨.
                }
            },

Conclusion
Callback 패턴으로 부르지 않으면 해당 라인에서 그냥 실행되어 버리고 callback에 등록하면 call이 오는 순간까지 기다림.

javascript/curring.html.body:
Curring
Definition

수학자 하스켈 커리(Haskell Curry)로부터 유래됨.

Example
ES6
const add = x => y => x + y;

ES5
function add(x, y) {
    if (typeof y === "undefined") {
        return function (y) {
            return x + y;
        }
    }

    return x + y;
}

Execution
add(2)(3); // 5
add(2)(3); // 5

